import React from "react";
import profileImg from "../assets/images/front_bg.jpg";
import "../css/Intro.css";

function Intro({ scrollToAbout }) {
  return (
    <section id="intro">
      <img src={profileImg} alt="프로필 이미지" />
      <h1>이재용 포트폴리오</h1>
      <p>프론트엔드 개발자</p>
      <div id="socialLinks">
        <a href="#">GitHub</a> | <a href="#">LinkedIn</a>
      </div>
      <button onClick={scrollToAbout}>About Me로 이동</button>
    </section>
  );
}

export default Intro;
